import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import PersonIcon from '@material-ui/icons/Person';
import { deepPurple } from '@material-ui/core/colors';
import Avatar from '@material-ui/core/Avatar';
import UploadButton from './uploadbutton_ver2';

import ResultTable from './resulttable';
import BackupOutlinedIcon from '@material-ui/icons/BackupOutlined';
import FileList from './filelist';
import KPMGlogo from '../../static/KPMG_logo_white.svg';
import PopUp from './popup';

const user = "user_name";

const useStyles = makeStyles((theme) => ({
    root: {
        textAlign:'center',
        height: '100%',
        width: '100%',
    },
    titleContainer: {
        color: 'white',
    },
    uploadContainer: {
        // backgroundColor: 'rgba(251,161,0, 0.5)'
    },
    dataContainer: {
        backgroundColor: 'rgba(107, 186, 167, 0.5)',
    },
    container: {
        border: '1px solid #444444',
    },
    dataTable: {
        display :'flex',
        flexDirection: 'row',
    }
}));



export default function Main() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Box height={900}>
                <div className={classes.titleContainer}>
                    <Container maxWidth="lg" className={classes.container}>
                        <Box height={130}>
                            <div style={{display:'flex', flexDirection:'row'}}>
                                <div><a href="/"><img src={KPMGlogo} alt="KPMG_logo" width='40%' style={{ width: '40%' }} /></a></div>
                                <div>Libor</div>
                            </div>

                        </Box>
                    </Container>
                </div>



                <div className={classes.dataContainer}>
                    <Container maxWidth="lg" className={classes.container}>
                        <Box height={700} className={classes.dataTable}>
                             <div>
                                 file list
                             </div>
                             <div>
                                 result value table 
                             </div>
                        </Box>
                    </Container>
                </div>

                <div className={classes.uploadContainer}>
                    <Container maxWidth="lg" className={classes.container}>
                        <Box height={120}> <UploadButton /></Box>
                    </Container>
                </div>
            </Box>
        </div>
    );
}
